import React from 'react';
import { Button, Modal } from 'react-bootstrap';
import {useSelector} from "react-redux";
import {RootState} from "../../store/reduxProvider";
interface props {
    visible : boolean,
    closeModal : ()=>void;

    products:{
        nameArrival : string,
        cost : number,

    }
}

function ModalMarket(props:props) {
    const logged = useSelector((state: RootState)=>state.auth.auth.isLogged);
    const data = props.products;
    return (

                <Modal show={props.visible} animation={true} style={styled.container} scrollable={false}>

                    <div style={{height: 440,textAlign: 'center'}}>
                        { logged?
                            <div >
                                <div>
                                    <h1>Danh sách sản phẩm</h1>
                                    <ul>
                                        {data.map((item) => (
                                            <li key={item.id}>{item.name}</li>
                                        ))}
                                    </ul>

                                </div>
                                {/*<Button  onClick={props.closeModal}>close</Button>*/}
                            </div>
                            :
                            <div>
                                <div></div>
                                <button>
                                    Đăng Nhập
                                </button>
                            </div>

                        }
                    </div>
                </Modal>

    );
}
const  styled={
    container:{height: 500,width: 430,marginLeft: 700,marginTop:60,borderRadius:10,alignContent: 'center'},
    buttonClose:{
        // height: 20,
        padding:10,
        borderRadius: 10,
        borderWidth: 1,
        borderColor: 'black'
    }
}
export default ModalMarket;
